import React from 'react'
import {Link} from 'react-router-dom'

export const DebtorsList = ({ payers }) => {
  if (!payers.length) {
    return <p className="center">Божників поки що немає</p>
  }

  return (
    <table>
      <thead>
      <tr>
        <th>№</th>
        <th>Код платника</th>
        <th>Відкрити</th>
        <th>Редагувати</th>
        <th>{payers.payerPeri}</th>
      </tr>
      </thead>

      <tbody>
      { payers.map((payer, index) => {
        if(payer.payerIncome >= 1000000) {
          return (
            <tr key={payer._id}>
              <td>{index + 1}</td>
              <td>{payer.payerCode}</td>
              <td>
                <Link to={`/detail/${payer._id}`}>Открыть</Link>
              </td>
              <td>
                <Link to={`/edit/${payer._id}`}>Редагувати</Link>
              </td>
            </tr>
          )
        }
      }) }
      </tbody>
    </table>
  )
}
